"""Kendal Tau"""

import scipy.stats as stats

#d = run_logistic_regr_wrapper(data3,'BAE SYSTEMS (NORSHIPCO)',[int(x) for x in range(5,21,5)])

def calculate_kendell(d):
  all_distance_scores = pd.DataFrame(columns=["Model_1","Model_2","tau","p-value"])
  for start_p in range(5,96,5):
    start_p = start_p ##5%,10%
    end_p = start_p + 5 ##10%, 15%
    start_df = d[d["model_percentage"] == start_p].reset_index(drop=True)
    end_df = d[d["model_percentage"] == end_p].reset_index(drop=True)
    X1 = list(start_df["importance_score"].values)
    X2 = list(end_df["importance_score"].values)
    #print(len(X1))
    #print(len(X2))


    #####
    ## tau, p_value = compare and calculate distance between X1 and X2
    tau, p_value = stats.kendalltau(X1, X2)
    #####
    all_distance_scores.loc[len(all_distance_scores.index)] = ["Model_"+str(start_p),"Model_"+str(end_p),tau,p_value]
  return all_distance_scores

